import React from 'react'
import './textBox.css'
import Title from './title'

class Box extends React.Component {
    render() {
        return (
            <body>
            <div class="box">
            <input class="form-control form-control-lg" type="text" placeholder=".form-control-lg"></input>
            </div>
            <Title/>
            </body>

        )
    }
}

export default Box;
